import React, {useEffect, useState} from "react";
import {useParams} from "react-router-dom";

import {apiGet} from "../utils/api";
import StatiscticsTable from "./StatisticsTable";

const StatisticsDetail = () => {
    const {id} = useParams();
    const [statistics, setStatistics] = useState({});

    useEffect(() => {
        apiGet("/api/invoices/statistics").then((data) => setStatistics(data));
    }, []);
  

    return (
        <>
            <div>
                <h1>Obecn√© statistiky</h1>
                <hr/>
                
                <StatiscticsTable
                    currentYearSum={statistics.currentYearSum}
                    allTimeSum={statistics.allTimeSum}
                    invoicesCount={statistics.invoicesCount}
                />
            
            </div>
        </>
    );
};

export default StatisticsDetail;
